@EU_Commission Μόνο λόγια ειστε.
Για ελάτε στην Ελλάδα λίγο.
Μόνο να μας κουνάτε το δάχτυλο ξέρετε

@EU_Commission asleep at the wheel as the virus just picks any vector on a flight from Italy, or a flight from South Korea, or a flight from Iran into Europe.
Shame on all of you.
Your ineptitude in handling this crisis is the same as the refugee one; the latter flowing again.

@EU_Commission Considering #ClimateChange , do you take the flight to all countries or do you go climatic and environmentally friendly by train?
or does all the "green talk" just apply to the people
@vonderleyen #EUGreenDeal
